import React from "react";
import { useCallback } from "react";
import { useUserAuth } from "../../contexts/AuthContext";
import { Container, Card, Button, Form, Alert } from 'react-bootstrap';
import { useNavigate } from "react-router-dom"
import { WebPlaybackSDK, webPlaybackSDKReady } from "react-spotify-web-playback-sdk";
import SongTitle from './SongTitle'


function Playback() {
    const { user, logout } = useUserAuth();
    const navigate = useNavigate();
    
    const AUTH_TOKEN = "BQAs8MFCUWmrBZCy9_xnrYvcL6VPZJh6ykj7Wmp1L8dWG_t4cR8-1wCW0SQKD-w3A_bByYJKJ2xSPaUCBm-K-hTgNAsd9i6rGlR4FDuVTlGtH-FlP_7Yz1Zo56A3rp-ETiC6SJNU-A-WNlKI2cuTC220EUyIi2bASxPlQ7CpXCRoQ7p3MOAiWwWL-OEw4un0w5jjA0AW49j2_w";
    const getOAuthToken = useCallback(callback => callback(AUTH_TOKEN), []);

    const MyPlayer = () => {
        const webPlaybackSDKReady = useWebPlaybackSDKReady();

        if (!webPlaybackSDKReady) return <div>Loading...</div>;

        return <div>Spotify App is ready!</div>;
    };

    
    
    
        return (
            <WebPlaybackSDK
                deviceName="My awesome Spotify app"
                getOAuthToken={getOAuthToken}
                volume={0.5}>
                <MyPlayer />
                
                <SongTitle />
            </WebPlaybackSDK>
        );
    };

export default Playback;
